import React from "react";

const News = () => {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-gray-800 amiri-font mb-6">
        الأخبار
      </h1>
      <p className="text-gray-600">صفحة الأخبار قيد التطوير...</p>
    </div>
  );
};

export default News;
